import React from 'react';
import './App.css';
import 'boxicons/css/boxicons.min.css';

function App() {
  return (
    <div className="App">
      <header className="test">  
        <div className="nav">
          <img className="logo1" src="logo.png" alt="logo" />
          <span className="start">
            <b>INDIAN RAILWAYS RESERVATION ENQUIRY</b>
          </span>
          <span className="control">
            <a href="project.html">Home</a> &nbsp; &nbsp; &nbsp; &nbsp;
            <a href="PnrEnquiry.html">PNR Enquiry</a> &nbsp; &nbsp; &nbsp;
            <a href="https://irctc.com/contact.html">Contact us</a> &nbsp; &nbsp; &nbsp;
            Social Media:
            <a href="https://twitter.com/railwayseva?lang=en"><i className='bx bxl-twitter'></i></a>
          </span>
          <img className="logo2" src="logo2.png" alt="Irctc" />
        </div>
      </header>
      <form action="https://rails.makemytrip.com/railways/tgspnrsearch/?pnr=" className="pnr">
        <label htmlFor="pnr">Enter your 10 digit PNR number</label>
        <input type="number" id="pnr" placeholder="PNR" name="pnr" />
        <br />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
